window.bookSummaryJSON = "<p>Every bloody thread has been leading to this....</p> <p>I’ve battled a lot of bad guys in my time, both as Gin Blanco and as the notorious assassin the Spider. But I’ve never faced off against anyone quite as powerful and deadly as the dastardly leader of the Circle secret society. </p> <p>Just when I finally have a lead on how I can defeat the evil group once and for all, new information comes to light that throws me for a loop. Suddenly, everyone and everything I love is in imminent peril of being destroyed, and I’m racing against the clock to figure out a way to save my friends.</p> <p>The stakes couldn’t be higher, and the danger has never been greater. Somehow, I need to weave one last strand in my web of death - and kill my enemies before they kill me....</p>"; 
